import { Component,ViewChild,ElementRef} from '@angular/core';
import { Router, NavigationExtras } from '@angular/router';
import { IonModal,AlertController } from '@ionic/angular';

import { AutenticacionService } from '../servicios/autenticacion.service';



@Component({
  selector: 'app-home',
  templateUrl: 'home.page.html',
  styleUrls: ['home.page.scss'],
})
export class HomePage {
  @ViewChild(IonModal) modal!: IonModal;

  constructor(private router: Router, public alertController : AlertController, private auth: AutenticacionService) {}

  public mensaje = ""
  public estado: String = "";

  public alertButtons = ['OK'];
  user = {
    usuario: "",
    password: "",
    confirmarpass: ""
  }
  
  enviarInformacion() {
    this.auth.login(this.user.usuario, this.user.password,).then(()=>{
      if (this.auth.autenticado ) {
        let navigationExtras: NavigationExtras = {
          state: { user: this.user }
        }
        this.router.navigate(['/login'], navigationExtras);
      } else {
        this.mensaje = "Porfavor ingrese sus credenciales.";
      }
    })
      
  }


  async mostrarConsola() {
    console.log(this.user);
    if (this.user.usuario != "" && this.user.password != "") {
      this.mensaje = "Usuario Conectado.";
    } else {
      const alert = await this.alertController.create({
        header: 'Credenciales incorrectas.',
        message: 'Usuario y/o contraseña incorrecto(s).',
        buttons: ['Aceptar'],
      });
      await alert.present();
    }
  }

  cancel() {
    this.modal.dismiss(null, 'cancel');
  }

   async confirm() {
    this.auth.register(this.user.usuario, this.user.password, this.user.confirmarpass).then((a: any)=> {
      if(a){
        this.estado = "usuario ya existe";
      }else{
        this.mensaje = "Registro exitoso";
        this.modal.dismiss(this.user.usuario, 'confirm');
      }
    })
  } 

   /* async confirm() {
    if (this.user.usuario != "" && this.user.password != "" && this.user.password == this.user.confirmarpass ) {
      this.estado = "Usuario ya existe.";
      this.modal.dismiss(null, 'confirmar');
    } else {
      const alert = await this.alertController.create({
        header: 'Formulario incompleto.',
        message: 'Porfavor complete todos los campos.',
        buttons: ['Aceptar'],
      });
      await alert.present();
    }
  }  */

  async irarestablecer(){
    this.router.navigate(['restablecerpass'])
  }

}


<ion-header [translucent]="true">
  <ion-toolbar>
    <a href="home" slot="start" class="navreg">TellevoApp</a>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">

  <ion-card class="cont">
    <ion-card-header class="titulo">
      <ion-card-title>Credenciales</ion-card-title>
    </ion-card-header>


    <ion-card-content class="cuerpocard">

      <ion-list class="lista">
        <ion-item class="input">
          <ion-input class="input" [(ngModel)]="user.usuario" label="Nombre Usuario" labelPlacement="floating"
          placeholder="Ingrese su Usuario">
          </ion-input>
        </ion-item><br>
        <ion-item class="input">
          <ion-input class="input"  [(ngModel)]="user.password" label="Contraseña" type="password" labelPlacement="floating"
          placeholder="Ingrese su Contraseña"></ion-input>
        </ion-item><br>
        <ion-item class="input">
          <ion-toggle class="input" aria-label="Success toggle" color="success" [checked]="true"> Recuerdame</ion-toggle>
        </ion-item><br>
        <ion-buttons>
          <ion-button color="dark" (click)="irarestablecer()">
            Olvidé mi contraseña
          </ion-button>
        </ion-buttons><br>

        <ion-button (click)="enviarInformacion()" size="small" shape="round">Conectar</ion-button>
        <ion-button id="open-modal" shape="round" size="small">
          Registrarse
        </ion-button><br>
        <div>

          <h1>{{mensaje}}</h1><br>
        </div>
      </ion-list>
    </ion-card-content>
  </ion-card>

  <ion-alert trigger="present-alert" header="Registro" subHeader="{{mensaje}}" 
      [buttons]="alertButtons">
    </ion-alert>
  <ion-modal trigger="open-modal">
      <ng-template>
        <ion-header>
          <ion-toolbar class="nav">
            <ion-buttons slot="start">
              <ion-button (click)="cancel()">Volver</ion-button>
            </ion-buttons>
            <ion-title class="titulo">Registro</ion-title>
            <ion-buttons slot="end" id="present-alert">
              <ion-button color="success" (click)="confirm()" [strong]="true">Confirmar</ion-button>
            </ion-buttons>
          </ion-toolbar>
        </ion-header>
        <ion-content class="ion-padding">
          <ion-item>
            <ion-input [(ngModel)]="user.usuario" label="Nombre Usuario" labelPlacement="floating"
              placeholder="Ingrese su Usuario"></ion-input>
          </ion-item>
          <ion-item>
            <ion-input [(ngModel)]="user.password" label="Contraseña" type="password" labelPlacement="floating"
              placeholder="Ingrese su Contraseña"></ion-input>
          </ion-item>
          <ion-item>
            <ion-input [(ngModel)]="user.confirmarpass" label="Confirmar contraseña" type="password" labelPlacement="floating"
              placeholder="Ingrese su Contraseña"></ion-input>
          </ion-item>
          <ion-item>
            <ion-label>{{estado}}</ion-label>
          </ion-item>
        </ion-content>
      </ng-template>
    </ion-modal>
    <!-- Modal Section End -->

</ion-content>
